import React from 'react';
import styled from 'styled-components';

const TopHeadline = () => {
  const Headline = styled.div`
    width: 100vw;
    height: 30px;
    font-size: 1rem;


  `;

  return (
    <Headline>
      <div><></>For any Queries With Your Order Mail Us At kermitcard@gmail.com</div>
    </Headline>
  );
};

export default TopHeadline;
